import React from "react";
import extracy from "./extracy_logo.png";
import lawfoundation from "./lawfoundation.png";
import { Grid } from "semantic-ui-react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faGlobeAmericas,
  faMapMarkerAlt,
} from "@fortawesome/free-solid-svg-icons";

// Noteworthy are the imports from Font Awesome and Semantic UI React. Those dependencies were added using
// npm (Node Package Manager). Not much logic is here as it is mostly for styling

const headingTextStyle = {
  color: "white",
  marginBottom: "3vh",
  marginRight: "0vw",
};

const iconStyle = {
  width: "10vw",
  color: "white",
};

const RightPanel = () => {
  return (
    <div>
      <Grid>
        <img
          src={extracy}
          alt=""
          style={{
            position: "relative",
            top: "20vh",
            left: "6vw",
            width: "55vw",
          }}
        ></img>



        <img
          src={lawfoundation}
          alt=""
          style={{
            position: "relative",
            top: "30vh",
            left: "45.5vw",
            height: "15vh",
          }}
        ></img>
      </Grid>
    </div>
  );
};

export default RightPanel;
